INSERT INTO `admin_config` (`id`, `name`, `value`, `description`, `created_at`, `updated_at`) VALUES
(1, 'Description', 'TPS là website đầu tiên liên kết trực tiếp với nông dân để bán sản phẩm tới bạn 1 cách thuận tiện nhất với giá tốt nhất. Để nâng cao giá trị và doanh thu cho người Nông dân Việt Nam.', 'TPS là website đầu tiên liên kết trực tiếp với nông dân để bán sản phẩm tới bạn 1 cách thuận tiện nhất với giá tốt nhất. Để nâng cao giá trị và doanh thu cho người Nông dân Việt Nam.', '2018-10-27 10:06:08', '2018-10-27 10:06:43'),
(2, 'Title', 'Thực phẩm sạch', 'Thực phẩm sạch', '2018-10-27 10:07:05', '2018-10-27 10:07:05'),
(3, 'Keywords', 'Thực phẩm sạch, thực phẩm an toàn', 'Thực phẩm sạch, thực phẩm an toàn', '2018-10-27 10:10:39', '2018-10-27 10:10:39'),
(4, 'Phone', '0938624417', '0938.6244.17', '2018-10-27 10:17:49', '2018-10-27 10:17:49'),
(5, 'Email', 'TPS@support.com', 'TPS@support.com', '2018-10-27 10:18:22', '2018-10-27 10:18:22'),
(6, 'Opening', '<p>Hận hạnh được phục vụ quý khách hàng. </p>\r\n<p>\r\n	<strong>Thứ 2 - Chủ Nhật:</strong>8:00 AM - 18:00 PM\r\n</p>', 'Thứ 2 - Chủ Nhật: 8:00 AM - 18:00 PM', '2018-10-27 10:18:42', '2018-10-27 10:55:49'),
(7, 'Contact', '<p><strong>Địa chỉ&nbsp;</strong>: Quận 1 , TP. Hồ Ch&iacute; Minh&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n\r\n<p><strong>Hotline</strong> : 0938.6244.17&nbsp;&nbsp;</p>\r\n\r\n<p><strong>Email</strong> : <a href=\"mailto:TPS@support.com\">TPS@support.com</a></p>', 'Địa chỉ: Quận 1\r\nHotline: 0938.6244.17\r\nEmail: TPS@support.com', '2018-10-27 10:19:12', '2018-10-27 11:09:41'),
(8, 'Introduce', '<p>TPS l&agrave; website đầu ti&ecirc;n li&ecirc;n kết trực tiếp với n&ocirc;ng d&acirc;n để b&aacute;n sản phẩm tới bạn 1 c&aacute;ch thuận tiện nhất với gi&aacute; tốt nhất.</p>\r\n\r\n<p>Để n&acirc;ng cao gi&aacute; trị v&agrave; doanh thu cho người N&ocirc;ng d&acirc;n Việt Nam.</p>', NULL, '2018-10-27 11:08:05', '2018-10-27 11:08:05');
